import { generateUtilityClass, generateUtilityClasses } from '../className';
export function getMenuItemUtilityClass(slot) {
  return generateUtilityClass('JoyMenuItem', slot);
}
const menuItemClasses = generateUtilityClasses('JoyMenuItem', ['root', 'focusVisible', 'disabled', 'selected', 'colorPrimary', 'colorNeutral', 'colorDanger', 'colorInfo', 'colorSuccess', 'colorWarning', 'variantPlain', 'variantSoft', 'variantOutlined', 'variantSolid']);
export default menuItemClasses;
